describe("setAspectRatio (method)",()=>{it("should change the aspect ratio to `1`",t=>{const e=window.createImage(),a=new Cropper(e,{ready(){const{options:e}=a;expect(e.aspectRatio).to.be.NaN,a.setAspectRatio(1),expect(e.aspectRatio).to.equal(1),t()}})}),it("should change the aspect ratio to `NaN`",t=>{const e=window.createImage(),a=new Cropper(e,{aspectRatio:1,ready(){const{options:e}=a;expect(e.aspectRatio).to.equal(1),a.setAspectRatio(NaN),expect(e.aspectRatio).to.be.NaN,t()}})})});